import './ExpenceFilter.css';

function ExpenceFilter(props) {
    const onChangeHandler = (event) =>{
        props.onChange(event.target.value);
    }

    return <div className='expenses-filter'>
        <div className='expenses-filter__control'>
            <label>Filter by year</label>
            <select onChange={onChangeHandler} >
                <option selected={props.selected === "2022"} value='2022'>2022</option>
                <option selected={props.selected === "2021"} value='2021'>2021</option>
                <option selected={props.selected === "2020"} value='2020'>2020</option>
                <option selected={props.selected === "2019"} value='2019'>2019</option>
            </select>
        </div>
    </div>
}

export default ExpenceFilter;
